import * as React from 'react';
import { request } from '../axios_helper';

export default class DataTable extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [],
            loading: true,
            error: null
        };
    }

    componentDidMount() {
        this.fetchData();
    }

    fetchData = () => {
        request('GET', '/api/prices') // Zmień URL na właściwy endpoint API
            .then(response => {
                this.setState({ data: response.data, loading: false });
            })
            .catch(error => {
                this.setState({ error: error.message, loading: false });
            });
    }

    render() {
        const { data, loading, error } = this.state;

        if (loading) {
            return <div>Loading...</div>;
        }

        if (error) {
            return <div>Error: {error}</div>;
        }

        return (
            <table className="table">
                <thead>
                    <tr>
                        <th>Region</th>
                        <th>Quarter</th>
                        <th>Type</th>
                        <th>Surface</th>
                        <th>Year</th>
                        <th>Price</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map(item => (
                        <tr key={`${item.region}-${item.quarter}-${item.year}`}>
                            <td>{item.region}</td>
                            <td>{item.quarter}</td>
                            <td>{item.type}</td>
                            <td>{item.surface}</td>
                            <td>{item.year}</td>
                            <td>{item.price}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        );
    }
}
